var chs = [];
for (var i = 0; i < rawTags.length; ++i) {
  var c = rawTags[i];
  c = tagTrans[c];
  chs.push(c);
}

const availableTags = atob(chs.join('')).split(',');

onUiUpdate(function(){
  let ac_txt2img_textarea = gradioApp().querySelector("#txt2img_prompt > label > textarea");
  if (ac_txt2img_textarea) {
    console.log("Adding autocomplete");
  
      function split( val ) {
        return val.split( /,\s*/ );
      }
      function extractLast( term ) {
        return split( term ).pop();
      }
      function limitItems(items) {
        if (items.length < 50) {
          return items;
        }
        return items.slice(0, 50);
      }
  
      $(ac_txt2img_textarea)
        // don't navigate away from the field on tab when selecting an item
        .on( "keydown", function( event ) {
          if ( event.keyCode === $.ui.keyCode.TAB &&
              $( this ).autocomplete( "instance" ).menu.active ) {
            event.preventDefault();
          }
        })
        .autocomplete({
          minLength: 0,
          source: function( request, response ) {
            // delegate back to autocomplete, but extract the last term
            response( limitItems($.ui.autocomplete.filter(
              availableTags, extractLast( request.term ) )) );
          },
          focus: function() {
            // prevent value inserted on focus
            return false;
          },
          select: function( event, ui ) {
            var terms = split( this.value );
            // remove the current input
            terms.pop();
            // add the selected item
            terms.push( ui.item.value );
            // add placeholder to get the comma-and-space at the end
            terms.push( "" );
            this.value = terms.join( ", " );
            return false;
          }
        });
  }
});
